import Card from "./Card.js";
import ExpenseDate from "./ExspenseDate";

function ExpenseItem(props) {
  return (
    <Card className="expens-item">
      <ExpenseDate date={props.date} />
      <div className="expens-item-description">
        <h2>{props.title}</h2>
        <div className="expens-item-price">${props.amount}</div>
      </div>
    </Card>
  );
}

export default ExpenseItem;
